            <description>FAD, also known as flavitan or adeflavin, belongs to the class of organic compounds known as flavin nucleotides. These are nucleotides containing a flavin moiety. Flavin is a compound that contains the tricyclic isoalloxazine ring system, which bears 2 oxo groups at the 2- and 4-positions. FAD is a drug which is used to treat eye diseases caused by vitamin b2 deficiency, such as keratitis and blepharitis. FAD is slightly soluble (in water) and a moderately acidic compound (based on its pKa). FAD has been found in human liver and muscle tissues, and has also been detected in multiple biofluids, such as feces and blood. Within the cell, FAD is primarily located in the cytoplasm, mitochondria, endoplasmic reticulum and peroxisome. FAD exists in all living organisms, ranging from bacteria to humans. In humans, FAD is involved in the risedronate action pathway, the ibandronate action pathway, the valine, leucine and isoleucine degradation pathway, and the pyrimidine metabolism pathway. FAD is also involved in several metabolic disorders, some of which include the oncogenic action OF L-2-hydroxyglutarate in hydroxygluaricaciduria pathway, gaba-transaminase deficiency, 4-hydroxybutyric aciduria/succinic semialdehyde dehydrogenase deficiency, and the saccharopinuria/hyperlysinemia II pathway. FAD is a condensation product of riboflavin and adenosine diphosphate. The coenzyme of various aerobic dehydrogenases, e.g., D-amino acid oxidase and L-amino acid oxidase. (Lehninger, Principles of Biochemistry, 1982, p972).</description>
