            <description>Calcium-activated and phospholipid-dependent serine/threonine-protein kinase involved in various processes such as regulation of the B-cell receptor (BCR) signalosome, apoptosis and transcription regulation. Plays a key role in B-cell activation and function by regulating BCR-induced NF-kappa-B activation and B-cell suvival. Required for recruitment and activation of the IKK kinase to lipid rafts and mediates phosphorylation of CARD11/CARMA1 at 'Ser-559', 'Ser-644' and 'Ser- 652', leading to activate the NF-kappa-B signaling. Involved in apoptosis following oxidative damage:in case of oxidative conditions, specifically phosphorylates 'Ser-36' of isoform p66Shc of SHC1, leading to mitochondrial accumulation of p66Shc, where p66Shc acts as a reactive oxygen species producer. Acts as a coactivator of androgen receptor (ANDR)-dependent transcription, by being recruited to ANDR target genes and specifically mediating phosphorylation of 'Thr-6' of histone H3 (H3T6ph), a specific tag for epigenetic transcriptional activation that prevents demethylation of histone H3 'Lys-4' (H3K4me) by LSD1/KDM1A. Also involved in triglyceride homeostasis. Serves as the receptor for phorbol esters, a class of tumor promoters</description>
