            <description>Water is a chemical substance that is essential to all known forms of life. It appears colorless to the naked eye in small quantities, though it is actually slightly blue in color. It covers 71% of Earth's surface. Current estimates suggest that there are 1.4 billion cubic kilometers (330 million m3) of it available on Earth, and it exists in many forms. It appears mostly in the oceans (saltwater) and polar ice caps, but it is also present as clouds, rain water, rivers, freshwater aquifers, lakes, and sea ice. Water in these bodies perpetually moves through a cycle of evaporation, precipitation, and runoff to the sea. Clean water is essential to human life. In many parts of the world, it is in short supply. From a biological standpoint, water has many distinct properties that are critical for the proliferation of life that set it apart from other substances. It carries out this role by allowing organic compounds to react in ways that ultimately allow replication. All known forms of life depend on water. Water is vital both as a solvent in which many of the body's solutes dissolve and as an essential part of many metabolic processes within the body. Metabolism is the sum total of anabolism and catabolism. In anabolism, water is removed from molecules (through energy requiring enzymatic chemical reactions) in order to grow larger molecules (e.g. starches, triglycerides and proteins for storage of fuels and information). In catabolism, water is used to break bonds in order to generate smaller molecules (e.g. glucose, fatty acids and amino acids to be used for fuels for energy use or other purposes). Water is thus essential and central to these metabolic processes. Water is also central to photosynthesis and respiration. Photosynthetic cells use the sun's energy to split off water's hydrogen from oxygen. Hydrogen is combined with CO2 (absorbed from air or water) to form glucose and release oxygen. All living cells use such fuels and oxidize the hydrogen and carbon to capture the sun's energy and reform water and CO2 in the process (cellular respiration). Water is also central to acid-base neutrality and enzyme function. An acid, a hydrogen ion (H+, that is, a proton) donor, can be neutralized by a base, a proton acceptor such as hydroxide ion (OH-) to form water. Water is considered to be neutral, with a pH (the negative log of the hydrogen ion concentration) of 7. Acids have pH values less than 7 while bases have values greater than 7. Stomach acid (HCl) is useful to digestion. However, its corrosive effect on the esophagus during reflux can temporarily be neutralized by ingestion of a base such as aluminum hydroxide to produce the neutral molecules water and the salt aluminum chloride. Human biochemistry that involves enzymes usually performs optimally around a biologically neutral pH of 7.4. (Wikipedia).</description>
