            <description>Pyridoxine 5-phosphate, also known as pyridoxine phosphoric acid or pyridoxine-5P, belongs to the class of organic compounds known as pyridoxine-5'-phosphates. These are pyridoxines that carry a phosphate group at the 5-position. Pyridoxine 5-phosphate is slightly soluble (in water) and a moderately acidic compound (based on its pKa). Pyridoxine 5-phosphate has been primarily detected in blood. Within the cell, pyridoxine 5-phosphate is primarily located in the cytoplasm. Pyridoxine 5-phosphate exists in all living organisms, ranging from bacteria to humans. In humans, pyridoxine 5-phosphate is involved in the vitamin B6 metabolism pathway. Pyridoxine 5-phosphate is also involved in the metabolic disorder called the hypophosphatasia pathway. 5-phosphate is a substrate for pyridoxine-5-phosphate oxidase and pyridoxal kinase.</description>
